(96, 1, '2022-09-15 02:57:06', '2022-09-15 02:57:06', '', 'Apple AirPods Pro (Late 2021)', '<ul>\r\n 	<li data-spm-anchor-id=\"a2o4l.pdp_revamp.product_detail.i0.2d84355aBpreDI\">Magic like you’ve never heard</li>\r\n 	<li>AirPods Pro have been designed to deliver Active Noise Cancellation for immersive sound, Transparency mode so you can hear your surroundings, and a customizable fit for all-day comfort. Just like AirPods, AirPods Pro connect magically to your Apple devices. And they’re ready to use right out of the case.</li>\r\n 	<li>Active Noise Cancellation</li>\r\n 	<li>Incredibly light noise-cancelling headphones, AirPods Pro block out your environment so you can focus on what you’re listening to. AirPods Pro use two microphones, an outward-facing microphone and an inward-facing microphone, to create superior noise cancellation. By continuously adapting to the geometry of your ear and the fit of the ear tips, Active Noise Cancellation silences the world to keep you fully tuned in to your music, podcasts, and calls.</li>\r\n 	<li>Transparency mode</li>\r\n 	<li>Switch to Transparency mode and AirPods Pro let the outside sound in, allowing you to hear and connect to your surroundings. Outward- and inward-facing microphones enable AirPods Pro to undo the sound-isolating effect of the silicone tips so things sound and feel natural, like when you’re talking to people around you. And Conversation Boost makes it easier to hear people during face-to-face conversations in noisy environments by focusing your AirPods Pro on the person talking directly in front of you.</li>\r\n 	<li>Customizable fit</li>\r\n 	<li>AirPods Pro offer a more customizable fit with three sizes of flexible silicone tips to choose from. With an internal taper, they conform to the shape of your ear, securing your AirPods Pro in place and creating an exceptional seal for superior noise cancellation.</li>\r\n 	<li>MagSafe Charging Case</li>\r\n 	<li>The MagSafe Charging Case delivers more than 24 hours of battery life¹. When it’s time to charge, just set the case down on your MagSafe charger, or a wireless charging mat, and let it charge. And when you’re away from a wireless charger, you can use the Lightning port to charge.</li>\r\n 	<li>Amazing audio quality</li>\r\n 	<li>A custom-built high-excursion, low-distortion driver delivers powerful bass. A superefficient high dynamic range amplifier produces pure, incredibly clear sound while also extending battery life. And Adaptive EQ automatically tunes music to suit the shape of your ear for a rich, consistent listening experience.</li>\r\n 	<li>Even more magical</li>\r\n 	<li>The Apple-designed H1 chip delivers incredibly low audio latency. A force sensor on the stem makes it easy to control music and calls and switch between Active Noise Cancellation and Transparency mode. And with Audio Sharing, you and a friend can share the same audio stream on two sets of AirPods — so you can play a game, watch a movie, or listen to a song together.²</li>\r\n</ul>', 'publish', 'open', 'closed', '', 'apple-airpods-pro-late-2021', '', '', '2023-01-01 00:00:04', '2023-01-01 00:00:04', '', 0, 'https://dev6.primeoutsourcing.shop/wordpress_ecommerce/?post_type=product&#038;p=96', 0, 'product', '', 0),
